;-------------------------------------------------
;----------------------DRAW SQUARE--------------
;-------------------------------------------------
drawSqr              PROC    FAR                             

                        mov ah,0Ch
        ;-------------------------------------------------
                        push si
                        push di
                        xor si,si
        draw_sqr_outer:
                        cmp si,SquareWidth
                        jg draw_sqr_eee
                        XOR DI,DI
        draw_sqr_inner:  
                        cmp di,SquareWidth
                        jg draw_sqr_outerr
                   
                        add cx,si
                        add dx,di
                        int 10h

                        sub dx,di
                        sub dx,di
                        int 10h

                        sub cx,si
                        sub cx,si
                        int 10h
                        add dx,di
                        add dx,di
                        int 10h

                        add cx,si
                        sub dx,di
                        inc di
                        jmp draw_sqr_inner
        draw_sqr_outerr:   
                        inc si
                        jmp draw_sqr_outer

        draw_sqr_eee:     
                        pop di
                        pop si
                     
        ;-------------------------------------------------
;
;INT 10h / AH = 0Ch - change color for a single pixel.
;input:
;AL = pixel color
;CX = column.
;DX = row.                
                        RET
drawSqr              ENDP
;-------------------------------------------------
;----------------------DRAW RECT--------------
;-------------------------------------------------
drawRect              PROC    FAR      

                        mov ah,0Ch
        ;-------------------------------------------------
                        push si
                        push di
                        xor si,si
                        dec SquareWidth
                      
        draw_rec_outer:
                        cmp si,SquareWidth
                        jg draw_rec_eee
                        XOR DI,DI
        draw_rec_inner:  
                        cmp di,SquareWidth
                        jg draw_rec_outerr
                   
                        add cx,si
                        add dx,di
                        int 10h

                        sub dx,di
                        sub dx,di
                        int 10h

                        sub cx,si
                        sub cx,si
                        int 10h
                        add dx,di
                        add dx,di
                        int 10h

                        add cx,si
                        sub dx,di
                        inc di
                        jmp draw_rec_inner
        draw_rec_outerr:   
                        inc si
                        cmp si,SquareWidth
                        jnz draw_rec_outer

        draw_rec_eee:     
                        pop di
                        pop si
                     
                     inc SquareWidth
        ;-------------------------------------------------
;
;INT 10h / AH = 0Ch - change color for a single pixel.
;input:
;AL = pixel color
;CX = column.
;DX = row.                
                        RET
drawRect              ENDP
;-------------------------------------------------
;----------------------RANDOM X Y IN CX DX--------------
;-------------------------------------------------
random_x_y      proc FAR
        
        rand_Again:
        ;   MAKE AX ALL RANDOM
        xor ax, ax
        int 1ah			;get random value from the ticks of the clock cx:dx
        mov bl, dl		;put the most changable byte of dx in bl
        int 1ah			;call the same interrupt to get another value in dx
        mov bh, dl		;put the most changable byte of dx in bl again
        mov ax, bx		;mov the random value to reg ax from bx

        ;   scaling the random value by number of squares (39 x 21) --  ([0-38] , [0-20])

        ;   generating X from 0 to 38 and storing in SI
        mov dx, 00h
        mov bx, 37d 	        ;the width of the screen
        mov cx,ax               ;storing random number
        div bx			;mod the random value with the width to get a random number from 0 to 38
        mov si, dx		;initialize reg si with the value

        ;   get the random value for the y axis
        mov ax, cx      ;getting random value back

        ;   generating Y from 0 to 32 and storing in DI
        mov dx, 00h
        mov bx, 18d		;the height of the screen
        div bx			;dx now has the value form 0 to 20
        mov di,dx

        ;       scaling SI and DI from sqrs number to actual X and Y locations in the grid
        ;       x starts from 5+9 and ends in 313 (5+34*9)     0-5+9   1-5+2*9     
    dummy_label_to_hide_func:
        ;       y from 29+9 ---> 196(29+18*9)
        mov cx,13d
        inc si
        rnd_x:
        add cx,8d
        dec si
        jnz rnd_x

        mov dx,44d
        rnd_y:
        add dx,8d
        dec di
        jnz rnd_y

        dec cx


        ;       get color of pixel 
        mov si,Cx
        mov di,dx       ; backup

        sub cx,4
        sub dx,4
        mov ah,0Dh
        int 10h                 ;AL = pixel color
        and al,al
        jnz rand_Again          ; SQuare  availible

        rand_eee:
        mov cx,si
        mov dx,di

                ret
random_x_y      ENDP
;------------------------------------------------
;----------------------BIG RANDOM X Y IN CX DX--------------
;-------------------------------------------------
Big_random_x_y      proc FAR
        Big_rnd_again:
        call random_x_y
        sub cx,3d
        sub dx,3d

        mov ah,0dh
        sub cx,7
        int 10h
        and al,al
        jnz Big_rnd_again
        sub dx,7
        int 10h
        and al,al
        jnz Big_rnd_again
        add cx,7d
        int 10h
        and al,al
        jnz Big_rnd_again

        add dx,7

                ret
Big_random_x_y      ENDP
