        mov dx,ScrY
        sub dx,SnakeWidth               
        sub dx,SnakeWidth               

        ; common X factor of all points in snake1
        mov ax,ScrX
        sub ax,SnakeWidth
        sub ax,SnakeWidth
        ; sub ax,SnakeWidth
        mov cl,sz1
        mov ch,0
initlpp:        sub ax,SnakeWidth
                LOOP initlpp
                mov cl,Sz1
                mov ch,0
initlpp2:       sub ax,SnakeWidth
                LOOP initlpp2

        ; parameters for loop
        mov cl,Sz1
        mov ch,0
        lea si,S1X
        lea di,S1Y

init_L1:     
        mov [si],ax
        mov [di],dx

        add ax,SnakeWidth
        add ax,SnakeWidth
        add si,2
        add di,2
        LOOP init_L1

        ; drawing snake1        //al = color ,          SquareWidth ,   CX=X    DX=Y
        mov cx,[s1x]
        mov dx,[s1y]
        mov di,offset Img_S1_H_L
        mov imgW,7
        mov imgH,7
        CALL Draw_Image
      
        lea SI,S1X
        lea Di,S1Y
        add si,2
        add di,2
        mov Bp,word ptr Sz1
        and bp,0FH
        dec Bp
        mov imgW,7
        mov imgH,7
init_draws1:
                mov cx,[si]
                mov dx,[di]
                push di
                mov di,offset Img_S1_B
                call Draw_Image
                pop di
                add si,2
                add di,2
                dec Bp
                jnz init_draws1



;---------------------------------------
; snake 2

        ; common X factor of all points in snake2
        mov ax,SnakeWidth
        add ax,SnakeWidth
        ; add ax,SnakeWidth

        ; parameters for loop
        mov cl,Sz2
        mov ch,0
        lea si,S2X
        lea di,S2Y

init_ll2:
        add ax,SnakeWidth
        add ax,SnakeWidth
        LOOP init_ll2

        mov cl,Sz2
        mov ch,0
init_L2:
        mov [si],ax
        mov [di],dx

        sub ax,SnakeWidth
        sub ax,SnakeWidth
        add si,2
        add di,2
        LOOP init_L2

        ; drawing snake2        //al = color ,          SquareWidth ,   CX=X    DX=Y
        mov cx,[s2x]
        mov dx,[s2y]
        mov di,offset Img_S2_H_R
        mov imgW,7
        mov imgH,7
        CALL Draw_Image
      
      
        lea SI,S2X
        lea Di,S2Y
        add si,2
        add di,2
        mov Bp,word ptr Sz1
        and bp,0FH
        dec Bp
        mov imgW,7
        mov imgH,7

init_draws2:
                mov cx,[si]
                mov dx,[di]
                push di
                mov di,offset Img_S2_B
                call Draw_Image
                pop di
                add si,2
                add di,2
                dec Bp
                jnz init_draws2

                ; initializing sending stuff
                lea ax,Img_S1_H_L
                mov s1h_img,ax

                lea ax,Img_S2_H_R
                mov s2h_img,ax


                ;  Set Divisor Latch Access Bit
                mov dx,3fbh ; Line Control Register
                mov al,10000000b ;Set Divisor Latch Access Bit
                out dx,al ;Out it
                ;  Set LSB byte of the Baud Rate Divisor Latch register.
                mov dx,3f8h
                mov al,01h
                out dx,al
                ;  Set MSB byte of the Baud Rate Divisor Latch register.
                mov dx,3f9h
                mov al,00h
                out dx,al
                ;  Set port configuration
                mov dx,3fbh
                mov al,00011011b
                ;  0:Access to Receiver buffer, Transmitter buffer
                ;  0:Set Break disabled
                ;  011:Even Parity
                ;  0:One Stop Bit
                ;  11:8bits
                out dx,al

                cmp is_main,1
                jnz no_draw_food

                CALL draw_food
                CALL draw_pwr 

