;-------------------------------------------------
;----------------------send char in bl--------------
;-------------------------------------------------
Sendchar        PROC    Far     ;put in bl - puts 0 in bp if fail

        push ax
        push dx

        ;Check that Transmitter Holding Register is Empty
        mov dx , 3FDH ; Line Status Register
        fffail:      
        In al , dx ;Read Line Status
        and al , 00100000b
        JZ fffail 

        mov al,bl
        mov dx , 3F8H ; Transmit data register
        out dx , al

        pop dx
        pop ax

                ret
Sendchar        ENDP

;-------------------------------------------------
;----------------------send word in bl--------------
;-------------------------------------------------
SendWord        PROC    Far     ;put in bl - puts 0 in bp if fail

        push ax

        mov ah,bh
        call Sendchar
        mov bl,ah
        call Sendchar

        pop ax

                ret
SendWord        ENDP


;-------------------------------------------------
;----------------------recieve char in bl--------------
;-------------------------------------------------
RecieveChar      PROC    Far    

        push ax
        push dx


        ;Check that Data is Ready
        mov dx , 3FDH ; Line Status Register
        bdsada:       
        in al , dx
        and al , 1b
        JZ bdsada 

        mov dx , 03F8H
        in al , dx
        mov bl,al

        pop dx
        pop ax
        ret
RecieveChar     ENDP
;-------------------------------------------------
;----------------------recieve Word in bl--------------
;-------------------------------------------------
RecieveWord      PROC    Far    

        push ax

        call RecieveChar
        mov al,bl
        call RecieveChar
        mov ah,bl

        mov bx,ax
        pop ax
        ret
RecieveWord     ENDP




